import { JeecgListMixin } from '@/mixins/JeecgListMixin';
import Vue from 'vue'; //高级查询modal需要参数

var superQueryFieldList = [{
  type: "date",
  value: "birthday",
  text: "生日"
}, {
  type: "string",
  value: "name",
  text: "用户名"
}, {
  type: "int",
  value: "age",
  text: "年龄"
}];
export default {
  name: "JeecgDemoList",
  mixins: [JeecgListMixin],
  components: {
    JeecgDemoModal: JeecgDemoModal,
    JSuperQuery: JSuperQuery,
    JeecgDemoTabsModal: JeecgDemoTabsModal
  },
  data: function data() {
    var _this = this;

    return {
      description: '用户管理页面',
      //字典数组缓存
      sexDictOptions: [],
      importExcelUrl: "".concat(window._CONFIG['domianURL'], "/test/jeecgDemo/importExcel"),
      //表头
      columns: [],
      //列设置
      settingColumns: [],
      //列定义
      defColumns: [{
        title: '#',
        dataIndex: '',
        key: 'rowIndex',
        width: 60,
        align: "center",
        customRender: function customRender(t, r, index) {
          return parseInt(index) + 1;
        }
      }, {
        title: '姓名',
        align: "center",
        dataIndex: 'name'
      }, {
        title: '关键词',
        align: "center",
        dataIndex: 'keyWord'
      }, {
        title: '打卡时间',
        align: "center",
        dataIndex: 'punchTime'
      }, {
        title: '性别',
        align: "center",
        dataIndex: 'sex',
        customRender: function customRender(text) {
          //字典值替换通用方法
          return filterDictText(_this.sexDictOptions, text);
        }
      }, {
        title: '年龄',
        align: "center",
        dataIndex: 'age'
      }, {
        title: '生日',
        align: "center",
        dataIndex: 'birthday'
      }, {
        title: '邮箱',
        align: "center",
        dataIndex: 'email'
      }, {
        title: '个人简介',
        align: "center",
        dataIndex: 'content'
      }, {
        title: '操作',
        dataIndex: 'action',
        align: "center",
        scopedSlots: {
          filterDropdown: 'filterDropdown',
          filterIcon: 'filterIcon',
          customRender: 'action'
        }
      }],
      url: {
        list: "/test/jeecgDemo/list",
        delete: "/test/jeecgDemo/delete",
        deleteBatch: "/test/jeecgDemo/deleteBatch",
        exportXlsUrl: "/test/jeecgDemo/exportXls"
      },
      fieldList: superQueryFieldList
    };
  },
  methods: {
    initDictConfig: function initDictConfig() {
      var _this2 = this;

      console.log("--我才是真的方法!--"); //初始化字典 - 性别

      initDictOptions('sex').then(function (res) {
        if (res.success) {
          _this2.sexDictOptions = res.result;
        }
      });
    },
    onetomany: function onetomany() {
      this.$refs.jeecgDemoTabsModal.add();
      this.$refs.jeecgDemoTabsModal.title = "编辑";
    },
    //跳转单据页面
    jump: function jump() {
      this.$router.push({
        path: '/jeecg/helloworld'
      });
    },
    //列设置更改事件
    onColSettingsChange: function onColSettingsChange(checkedValues) {
      var _this3 = this;

      var key = this.$route.name + ":colsettings";
      Vue.ls.set(key, checkedValues, 7 * 24 * 60 * 60 * 1000);
      this.settingColumns = checkedValues;
      var cols = this.defColumns.filter(function (item) {
        if (item.key == 'rowIndex' || item.dataIndex == 'action') {
          return true;
        }

        if (_this3.settingColumns.includes(item.dataIndex)) {
          return true;
        }

        return false;
      });
      this.columns = cols;
    },
    initColumns: function initColumns() {
      //权限过滤（列权限控制时打开，修改第二个参数为授权码前缀）
      //this.defColumns = colAuthFilter(this.defColumns,'testdemo:');
      var key = this.$route.name + ":colsettings";
      var colSettings = Vue.ls.get(key);

      if (colSettings == null || colSettings == undefined) {
        var allSettingColumns = [];
        this.defColumns.forEach(function (item, i, array) {
          allSettingColumns.push(item.dataIndex);
        });
        this.settingColumns = allSettingColumns;
        this.columns = this.defColumns;
      } else {
        this.settingColumns = colSettings;
        var cols = this.defColumns.filter(function (item) {
          if (item.key == 'rowIndex' || item.dataIndex == 'action') {
            return true;
          }

          if (colSettings.includes(item.dataIndex)) {
            return true;
          }

          return false;
        });
        this.columns = cols;
      }
    }
  },
  created: function created() {
    this.initColumns();
  }
};
